	'wm-license-gfdl-wiki-link' => 'w:ml:ഗ്നൂ സ്വതന്ത്ര പ്രസിദ്ധീകരണാനുമതി',
	'wm-license-gpl-text' => "ഈ സൃഷ്ടി [[{{int:wm-license-free-software-wiki-link}}|സ്വതന്ത്ര സോഫ്റ്റ്‌‌വേറാണ്]]; [[{{int:wm-license-fsf-wiki-link}}|സ്വതന്ത്ര സോഫ്റ്റ്‌‌വേർ സമിതി]] പ്രസിദ്ധീകരിച്ചിട്ടുള്ള '''[[{{int:wm-license-gpl-wiki-link}}|ഗ്നു സാർവ്വജനിക അനുവാദപത്രം]]''' പതിപ്പ് 2 അല്ലെങ്കിൽ പുതിയ പതിപ്പുകൾ പ്രകാരം താങ്കൾക്കിത് പുനർവിതരണം ചെയ്യാൻ ഒപ്പം/അല്ലെങ്കിൽ മാറ്റം വരുത്താൻ കഴിയുന്നതാണ്. ഈ സൃഷ്ടി ഉപകാരപ്രദമാകുമെന്ന വിശ്വാസത്തിലാണ് വിതരണം ചെയ്യുന്നത്, പക്ഷേ യാതൊരു '''ഗുണമേന്മ ഉത്തരവാദിത്വവും വഹിക്കുന്നില്ല''';  '''വ്യാപാരയോഗ്യം''' എന്നോ '''പ്രത്യേക ഉപയോഗത്തിനനുയോജ്യം''' എന്നോ ഉള്ള യാതൊരു ഗുണമേന്മ ഉത്തരവാദിത്വവും ഉൾപ്പെടുന്നില്ല. കൂടുതൽ വിവരങ്ങൾക്ക് ഗ്നു സാർവ്വജനിക അനുവാദപത്രത്തിന്റെ [{{int:wm-license-gpl-2-full-link}} പതിപ്പ് 2], [{{int:wm-license-gpl-3-full-link}} പതിപ്പ് 3] എന്നിവ കാണുക.",
