	'wm-license-cc-zero-explanation' => "La përson-a ch'a l'ha associà un travaj con sto document-sì a l'ha smonù ël travaj a Commons an arnonsiand a tùit ij sò drit an sël travaj ant ël mond sota la lege dij drit d'autor e ai relativ o vzin drit legaj che chila o chiel a l'avèisso an sël travaj, për l'estension përmëttùa da la lèj. Travaj sota CCO a ciamo pa atribussion. Quand ch'as sita ël travaj, chiel a l'ha pa dabzògn d'avèj l'aprovassion ëd l'autor.",
